package react.debuglogmanager;

public class Logger{
    public void debugStatment(int msg){
        System.out.println("DebugSym -> " + String.valueOf(msg));
    }
    public void debugStatment(Integer msg){
        System.out.println("DebugSym -> " + String.valueOf(msg));
    }
    public void debugStatment(Float msg){
        System.out.println("DebugSym -> " + String.valueOf(msg));
    }
    public void debugStatment(Double msg){
        System.out.println("DebugSym -> " + String.valueOf(msg));
    }
    public void debugStatment(String msg){
        System.out.println("DebugSym -> " + String.valueOf(msg));
    }
    public void debugStatment(char msg){
        System.out.println("DebugSym -> " + String.valueOf(msg));
    }
}